INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1001, 1.4, "春咲 ひより", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1, 1, 0, 0, 0, 1, 2, 0, "お！\nあそこに困ってそうな人発見！", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1002, 1.4, "草野 優衣", "みんなみたいに\nわたしも強くならなきゃ", "わ、わたし、\nなに言ってるんだろ\nあはは…", 1, 1, 0, 0, 0, 1, 2, 0, "大切な人を\n守れるようになりたい…って", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1003, 1.4, "士条 怜", "フェンシングを始めてみては？", "少しは磨かれると思いますよ。", 1, 1, 0, 0, 0, 1, 2, 0, "キミに必要な集中力と感性が", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1004, 1.5, "穂高 みそぎ", "ねぇ、にいちゃん！", "みそぎはねぇ、\nかくれんぼやりたい！", 1, 1, 0, 0, 0, 1, 2, 0, "今日はなにして遊ぶ？", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1006, 1.4, "風宮 あかり", "風宮あかりです", "私といっしょに…\nいかない？", 1, 1, 0, 0, 0, 1, 2, 0, "ねぇ…", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1007, 1.5, "出雲 宮子", "出雲宮子なのー", "食べ物の恨みは怖いのー", 1, 1, 0, 0, 0, 1, 2, 0, "プリンたべたいのー", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1008, 1.4, "虹村 雪", "ボクは虹村雪。", "いいよ。\n見られることは運命さ…", 1, 1, 0, 0, 0, 1, 2, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1009, 1.4, "柊杏奈", "フッ…聞いて後悔するがいい！", "人呼んで「疾風の冥姫」!!", 1, 1, 0, 0, 0, 1, 2, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1010, 1.5, "姫宮 真歩", "マホマホ王国のプリンセス、\nまほ姫どす", "ほんまおおきにやわ～♪", 1, 1, 0, 0, 0, 1, 2, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1011, 1.4, "衣之咲 璃乃", "衣之咲璃乃です！", "ここで会ったが\n100年目～！", 1, 1, 0, 0, 0, 1, 2, 0, "生き別れたお兄ちゃんを探して\n三千世界！", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1012, 1.4, "柏崎 初音", "私はハツネ、\n結構強いんだよ。\nきらーん☆", "…って、お願い！\n誰にも言わないでおいて～！", 1, 1, 0, 0, 0, 1, 2, 0, "ち、超能力って…\n何のことかな～？", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1016, 1.4, "美波 鈴奈", "ちょす！\n美波鈴奈だよ～♪", "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1, 1, 0, 0, 0, 1, 2, 0, "一応カリスマ読モJKやってまっす！", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1017, 1.4, "喜屋武 香織", "はいたーい。\n喜屋武香織さー。", "でも、沖縄もとってもいいとこさー", 1, 1, 0, 0, 0, 1, 2, 0, "東京は遊園地みたいなところさー", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1018, 1.4, "支倉 伊緒", "支倉伊緒です。", "イオちゃんって呼んでね。", 1, 1, 0, 0, 0, 1, 2, 0, "先生って呼ばれるのは\nくすぐったいから", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1020, 1.5, "茜 ミミ", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", "ミミをおいてかないでぇ～", 1, 1, 0, 0, 0, 1, 2, 0, "あ！/\お兄ちゃ～ん\nまってよ～", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1021, 1.5, "栗林 くるみ", "あ…あの…えっと…\n栗…林…くるみ…です……", "ふぇぇぇぇぇん……", 1, 1, 0, 0, 0, 1, 2, 0, "あの……\nふぇ……", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1022, 1.4, "風宮 より", "風宮よりです。\nあああああ！", "なんてありがとうございます！", 1, 1, 0, 0, 0, 1, 2, 0, "こんな私に貴重な時間を\n割いていただき、", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1023, 1.5, "北条 綾音", "私、アヤネ！\nぷうきちと一緒についてってあげるね！", "私こっち行きたいー\nね、早く早くー", 1, 1, 0, 0, 0, 1, 2, 0, "おにいちゃんどこいくの？\nえ？", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1025, 1.4, "天野 すずめ", "わっ…わっ…私、\n天野すずめといいます！", "これて何か違う…\nあああすみません！", 1, 1, 0, 0, 0, 1, 2, 0, "ふ、不束者ですが\nどうぞ末永く…って、", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1027, 1.4, "倉石 恵理子", "……クスクス…私は\n…倉石恵理子……", "離しませんわ………\n絶対に…!!", 1, 1, 0, 0, 0, 1, 2, 0, "あなたは…運命の……\n伴侶……", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1028, 1.4, "佐々木 咲恋", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", "…そうでしょ？？", 1, 1, 0, 0, 0, 1, 2, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1029, 1.4, "桜井 望", "桜井望だよ！\nよろしくねっ", "あはは、\n私もまだまだだなぁ～", 1, 1, 0, 0, 0, 1, 2, 0, "ぇっと…\nキミ、私のこと知らないの?!", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1030, 1.4, "ニノン・ジュベール", "デケデケデンっ！", "ショーグン、\nワタシと一緒に天下統一デース！", 1, 1, 0, 0, 0, 1, 2, 0, "初めまして、\n私はニノン・ジュベール申すデス！", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1031, 1.4, "上喜 しのぶ", "上喜しのぶです。\n手元のドクロが父です。", "おかしいですね……", 1, 1, 0, 0, 0, 1, 2, 0, "でもって私の隣にいるのが……\nえ、見えない？", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1033, 1.5, "野戸まひる", "目指すはビッグな\nお笑い芸人だっぺ！", "そう、\nオラのボケに突っ込める相方が…！", 1, 1, 0, 0, 0, 1, 2, 0, "けんども\nそれには足りないモンが…", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1034, 1.4, "綾瀬 ゆかり", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", "ちょ\nちょっと一杯飲んできます…！", 1, 1, 0, 0, 0, 1, 2, 0, "ちょっと緊張しちゃって…", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1036, 1.5, "氷川 鏡華", "氷川鏡華…です", "これ以上お話しすることは…\nないです！", 1, 1, 0, 0, 0, 1, 2, 0, "知らない人とは話しちゃいけないので", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1038, 1.4, "柏崎 栞", "柏崎…栞です。", "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1, 1, 0, 0, 0, 1, 2, 0, "……あ、アラーム。", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1040, 1.4, "双葉 碧", "ふ、双葉碧です。", "野に咲く花が、\n唯一の話相手です。", 1, 1, 0, 0, 0, 1, 2, 0, "私、一人も友達がいなくて……", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1042, 1.4, "三角 千歌", "三角千歌です。", "そう思っています。", 1, 1, 0, 0, 0, 1, 2, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1043, 1.4, "安芸 真琴", "安芸真琴だ。", "う、疑ってすまなかったな…", 1, 1, 0, 0, 0, 1, 2, 0, "あぁ？\nお前のそいつの仲間か？", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1044, 1.4, "イリヤ・オーンスタイン", "わらわこそは夜を総べる者！", "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1, 1, 0, 0, 0, 1, 2, 0, "生けとし生ける全ての者よ！", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1045, 1.4, "遠見 空花", "そこで騎士は妖精を乱暴に……", "ｌク、クウカに何かご用ですか!?", 1, 1, 0, 0, 0, 1, 2, 0, "ぐふふふふ……はっ！", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1046, 1.4, "宮坂たまき", "宮坂たまきにゃ♪\n猫はいいにゃよ？", "う～ん…\n猫ってホントに最高にゃ～♪", 1, 1, 0, 0, 0, 1, 2, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1048, 1.4, "大神 美冬", "大神美冬よ！", "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1, 1, 0, 0, 0, 1, 2, 0, "それでは早速クエストに…", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1049, 1.4, "星野静流", "星野静流だよ！", "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1, 1, 0, 0, 0, 1, 2, 0, "クエストもバトルも\n掃除も洗濯も", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1050, 1.5, "玉泉美咲", "アタシは玉泉美咲。", "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1, 1, 0, 0, 0, 1, 2, 0, "見ての通りの\nセクシー美少女で", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1052, 1.4, "リマ", "？？？", "？？？？", 1, 1, 0, 0, 0, 1, 2, 0, "？？？？", 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1053, 1.5, "モニカ・ヴァイスヴィント", "モニカ・ヴァイスヴィントだ。", "そ、そこまでいうなら\nもらってやる", 1, 1, 0, 0, 0, 1, 2, 0, "菓子でつろうなどと\n稚拙な策を……", 0);
